    @PostMapping(value = "/leave/{id}", produces = MediaType.APPLICATION_JSON_VALUE)
    public ResponseEntity<String> applyForLeave(@PathVariable String id, @RequestBody User leave) {
        boolean onleave = leave.isOnleave();
        String nominee = leave.getNominee() != null ? leave.getNominee() : "";
        List<String> nominator = leave.getNominators() != null ? leave.getNominators() : new ArrayList<>();
        String to = leave.getDateto() != null ? leave.getDateto() : "";
        String from = leave.getDatefrom() != null ? leave.getDatefrom() : "";

        User nomineeObject = userRepository.findById(nominee).get();
        if(nomineeObject.isOnleave()==true) {
            return new ResponseEntity<>("{\"allowed\" : false}", HttpStatus.EXPECTATION_FAILED);
        }

        User nominatorObject = userRepository.findById(id).get();

        nominatorObject.setOnleave(onleave);
        nominatorObject.setNominee(onleave ? nominee : "");
        nominatorObject.setDateto(onleave ? to : "");
        nominatorObject.setDatefrom(onleave ? from : "");
        userRepository.save(nominatorObject);
        List<String> nominatorList = nomineeObject.getNominators() == null ? new ArrayList<>() : nomineeObject.getNominators();
        if(onleave) {
            nominatorList.add(nominator.get(0));
        } else {
            nominatorList.remove(nominator.get(0));
        }
        nomineeObject.setNominators(nominatorList);
        userRepository.save(nomineeObject);

        List<UserUtility> utilityList = userUtilityRepository.findAll();
        UserUtility userUtilityNominee = utilityList.stream().filter(x -> x.getId().equals(nominee)).collect(Collectors.toList()).get(0);
        UserUtility userUtilityNominator = utilityList.stream().filter(x -> x.getId().equals(nominator.get(0))).collect(Collectors.toList()).get(0);

        if(onleave) {
            emailService.sendSimpleMessage(new ArrayList<>(Arrays.asList(userUtilityNominee.getEmailID(), "devalmmudia@gmail.com", "shalakaspatankar@gmail.com", "chaityachheda@gmail.com", "ritwikdeshpande01@gmail.com", "isayushsingh@gmail.com", "kvvsuryavanshi@gmail.com")), "Appointing as Nominee",
                    "Hi " + userUtilityNominee.getName() + ",\n\n" + userUtilityNominator.getName() + " has appointed you as nominee.\n\nRegards,\nDigiDocs");

            for (UserUtility user : utilityList) {
                if (!user.getId().equals(nominee) && !user.getId().equals(nominator.get(0))) {
                    emailService.sendSimpleMessage(new ArrayList<>(Arrays.asList(user.getEmailID(), "devalmmudia@gmail.com", "shalakaspatankar@gmail.com", "chaityachheda@gmail.com", "ritwikdeshpande01@gmail.com", "isayushsingh@gmail.com", "kvvsuryavanshi@gmail.com")), userUtilityNominator.getName() + " is on leave",
                            "Hi " + user.getName() + ",\n\n" + "In the absence of " + userUtilityNominator.getName() + ", his/her application will be approved by " + userUtilityNominee.getName() + "." + "\n\nRegards,\nDigiDocs");
                }
            }
        }

        try {
            return new ResponseEntity<>("{\"allowed\" : true}", HttpStatus.OK);
        } catch (Exception e) {
            return new ResponseEntity<>(null, HttpStatus.OK);
        }
    }


