    @PostMapping(value = "/notifications/{id}")
    public ResponseEntity<String> deleteNotificationsToken(@PathVariable String id, @RequestBody String tokenJson) {
        System.out.println("Token Json : " + tokenJson);
        System.out.println("Id : " + id);
        JsonObject jsonObj = new JsonParser().parse(tokenJson).getAsJsonObject();
        ObjectMapper objectMapper = new ObjectMapper();
        String token = jsonObj.get("token").getAsString();
        System.out.println("User id : " + id);
        try {
            UserUtility userUtility = userUtilityRepository.findById(id).orElse(null);
            System.out.println("Token : " + token);
            System.out.println("Id : " + userUtility.getId());
            List<String> t = userUtility.getToken();
            if(t == null || t.size()==0) {
                t = new ArrayList<>();
            }
            t.remove(token);
            userUtility.setToken(t);
            userUtilityRepository.save(userUtility);
            return new ResponseEntity<>("Token : " + token + " Deleted", HttpStatus.OK);
        } catch (Exception e) {
            return new ResponseEntity<>(null, HttpStatus.INTERNAL_SERVER_ERROR);
        }
    }

