    @GetMapping(value = "/workflow", produces = MediaType.APPLICATION_JSON_VALUE)
    public ResponseEntity<String> workflowByUser(@RequestParam(required = false) String User) {
        System.out.println("Workflow for user : " + User);
        try {
            List<Workflow> workflows = new ArrayList<Workflow>();
            if(User != null) {
                workflows = workflowRepository.findAll().stream().filter(x -> x.getUser().equals(User)).collect(Collectors.toList());
            }
            for(Workflow w : workflows) {
                System.out.println(w.getTitle());
            }
            if (workflows.isEmpty()) {
                return new ResponseEntity<>(HttpStatus.NO_CONTENT);
            }

            List<String> workflowJsonList = new ArrayList<>();

            for(Workflow w : workflows) {
                String hash = getSHA(w.getJsonString());
                if(hash.equals(w.getHash())) {
                    workflowJsonList.add(w.getJsonString());
                } else {
                    workflowJsonList.add("{\"id\" : \"" + w.getId() + "\", \"status\" : \"corrupted\"}");
                }
                //workflowJsonList.add(w.getJsonString());
            }
            String result = StringUtils.join(workflowJsonList, ',');
            return new ResponseEntity<>("[ " + result + " ]", HttpStatus.OK);
        } catch (Exception e) {
            return new ResponseEntity<>(null, HttpStatus.INTERNAL_SERVER_ERROR);
        }
    }

